Verenigde Staten
Horror / Science-Fiction
89 minuten

goed

met Sean Patrick Flanery, Kristin Booth en Rod Taylor

Een vredig klein dorpje in Amerika wordt opgeschokt door bloeddorstige raven. De inwoners zoeken hun toevlucht in een 
restaurantje, waarbij ze de ramen en deuren barricaderen. De lust naar mensenvlees is zo groot dat de inwoners nergens meer 
veilig lijken te zijn. Het is aan sheriff Wayne om uit te zoeken waar de raven vandaan komen en hoe ze gestopt kunnen worden. 
Al snel blijkt dat boer Oskar er meer van af weet.
